  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  NavbarText
} from 'reactstrap';

export default function About() {
    return (
        
      <div>
        <Layout />
        <p>This is the about page</p>
      </div>
    );
  }
